const float MAX_ELEVATION = 0.33;

vec3 sphere_center = vec3(0.0, 0.0, 0.0);
float sphere_radius = 2.0;

vec3 latLonTo3D(vec2 latlon) {
    vec3 ret;
    ret.x = sin(latlon.y) * cos(latlon.x);
    ret.z = cos(latlon.y) * cos(latlon.x);    
    ret.y = sin(latlon.x);
    return ret;
}

vec2 _3DToLatLon(vec3 p) {
    vec2 ret;
    ret.x = asin(p.y);
    ret.y = atan(p.x, p.z);
    return ret;
}

vec2 computeuv(vec3 P) {

    float lat = asin(P.y/length(P));
    float lon = -atan(P.z, P.x);

    return vec2(lon*0.5, lat) / 3.1415 + 0.5;
}

bool rayMarching(in vec3 origin, in vec3 ray, out vec3 m, out vec3 normal);

vec4 render(in vec3 ray, in vec3 m, in vec3 normal, in vec3 light) {

    vec2 uv = computeuv(m);
    vec4 material = texelFetch(iChannel0, ivec2(uv * vec2(200.0, 100.0)),0);

    // test self shadow
    vec3 lightM, lightN, testM = m - light * 10.0;
    float shadow = 1.0;

    if(rayMarching(testM, light, lightM, lightN)) {
        if(length(m - lightM) > 0.01) {
            shadow = 0.5;
        }
    }

    float diffuse = clamp(dot(-normal, light), 0.0, 1.0);
     return material * (diffuse*1.25 * shadow); //+ specular * specular_color;//* mask;
}

struct Sphere {
    vec3 center;
    float radius;
};

bool intersectSphere(in vec3 ro, in vec3 rd, in Sphere sphere, out vec3 col) {
    vec3 cp = ro + rd * dot(rd, sphere.center - ro);
    float H = length(cp-sphere.center);    
    float h = sqrt(sphere.radius*sphere.radius - H*H);
    col = cp - rd * h;
    return H<sphere.radius;
}

float discretize(float f, float width) {
    return floor(f/width) * width;
}

vec2 discretize(vec2 v, float width) {
    return floor(v/width) * width;
}

float getHeight(vec3 m) {
    vec2 uv = computeuv(m);     
    float height = texelFetch(iChannel2, ivec2(uv.x*200.0,uv.y*100.0),0).r * MAX_ELEVATION;    

    return height;
   // return discretize(height, 0.0125);
}

const float PIXEL_SIZE = 3.1415/100.0;


vec3 computeNormal(inout vec3 pos) {
    vec2 latlon = _3DToLatLon(normalize(pos));

    const float latlonPixel = PIXEL_SIZE;

    vec2 discreteLatlon = discretize(latlon, latlonPixel);
    vec3 filteredPos = latLonTo3D(discreteLatlon + 0.5*latlonPixel);

    return normalize(filteredPos);
}


vec3 computeNormalAndSnapPoint(inout vec3 pos) {

    float posLen = length(pos);
    vec2 latlon = _3DToLatLon(pos/posLen);

    const float latlonPixel = PIXEL_SIZE;

    vec2 discreteLatlon = discretize(latlon, latlonPixel);
    vec3 filteredPos = latLonTo3D(discreteLatlon + 0.5*latlonPixel);
    vec3 normal = normalize(filteredPos);

    vec3 nx = normalize(cross(vec3(0,1,0), normal));
    vec3 ny = cross(normal, nx);    

    vec2 dll = (latlon - discreteLatlon) / latlonPixel;

    bool TL = dll.x > dll.y;
    bool BL = dll.x < (1.0 - dll.y);

    if(TL) {
         if(BL) {
            latlon.y = latlon.y;

            normal = -nx;
         }
         else {
            latlon.x = discreteLatlon.x + latlonPixel;         
            normal = +ny;
         }
    }
    else {
         if(BL) {
            latlon.x = discreteLatlon.x;
            normal = -ny;
         }
         else {
                 latlon.y = discreteLatlon.y + latlonPixel;         

            normal = +nx;
         }
    }


    // snap
   //pos = latLonTo3D(latlon) * posLen;

    return normal;
}



const float STEP = 0.005;

bool rayMarching(in vec3 origin, in vec3 ray, out vec3 m, out vec3 normal) {
    float testingHeight = MAX_ELEVATION;

    if(!intersectSphere(origin, ray, Sphere(sphere_center, sphere_radius + testingHeight), m)) {
        return false;
    }

    normal = normalize(m);

    // Start slow scan
    for(int i = 0; i<400; i++) {
        float r = length(m - sphere_center) - sphere_radius;

        // m exits sphere
        if(r > MAX_ELEVATION+STEP) {
            return false;
        }

        float dist = r - getHeight(m);

        // side collision
        if(dist < -STEP) {
            normal = computeNormalAndSnapPoint(m);
            return true;
        }
        if(dist < STEP) {
            normal = computeNormal(m);
            m += ray * dist;
            return true;
        }
        m += ray * STEP;    
    }

    return false;
}

vec4 background(vec3 ro, vec3 rd, vec2 uv) {

    float ar1 = 2.2;
    vec3 inter;

    vec4 background = mix(vec4(0), vec4(0,0,0.5,0), length(uv));

    vec3 roc = -ro;
    vec3 cc = ro + rd * dot(roc, rd);

    float R = length(cc);

    float r1 = 2.0;
    float r2 = 2.15;

    float p = (R - r1)/(r2-r1);

    float r = 205. - p * 250.;
    float g = 255. - p * 202.;
    float b = 255. - p*p*p*120.;

    vec4 halo = clamp(vec4(r, g, b, 1.0) / 255., 0.0, 1.0);    

    return background + halo;
}

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    float ratio	= iResolution.x/iResolution.y;
    vec2 uv = fragCoord.xy/iResolution.y - vec2(ratio/2.0, 0.5);
    float zoom = getData(iChannel1, DATA_ZOOM).x;
    vec2 rotation = getData(iChannel1, DATA_ROT).xy;

    float alpha = rotation.x + iTime*0.5;
    float beta = clamp(rotation.y, -0.66,0.66);
    beta = rotation.y;

    vec3 target = vec3(0,0,0);
    vec3 ro;
    ro.x = sin(alpha) * cos(beta);
    ro.z = cos(alpha) * cos(beta);    
    ro.y = sin(beta);    
    ro *= zoom;
    vec3 rd = normalize(vec3(uv, 1.));

    // camera
    vec3 k = normalize(target - ro);
    vec3 i = normalize(cross(k, vec3(0.0,1.0,0.0)));
    vec3 j = cross(i, k);
    mat3 camera = mat3(i, j, k);

    rd = camera * rd;

    vec3 m, normal;
    vec3 light = camera * normalize(vec3(1,0,1));

    if(rayMarching(ro, rd, m, normal)) {
        fragColor = render(rd, m, normal, light);
    }
    else {
       fragColor = background(ro, rd, uv);
    }
}

const int DATA_ZOOM       = 0;
const int DATA_ROT        = 1;
const int DATA_ROT_ORIGIN = 2;
const int DATA_MOUSECLICK = 3;

#define getData(chan, i) texelFetch(chan, ivec2(i, 0), 0)

const int KEY_LEFT  = 37;
const int KEY_UP    = 38;
const int KEY_RIGHT = 39;
const int KEY_DOWN  = 40;

const float ZOOM_SPEED = 2.0;
const float ZOOM_MIN   = 2.5;
const float ZOOM_INIT  = 5.0;

#define isPressed(key) bool(texelFetch( iChannel1, ivec2(key,0),0 ).x)
#define setData(i, data) if(int(fragCoord.x) == i) fragColor = vec4(data);

void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    float zoom = getData(iChannel0, DATA_ZOOM).x;
    if (zoom == 0.0) zoom = ZOOM_INIT;

    if(isPressed(KEY_UP))   zoom -= ZOOM_SPEED * iTimeDelta;
    if(isPressed(KEY_DOWN)) zoom += ZOOM_SPEED * iTimeDelta;

    zoom = max(zoom, ZOOM_MIN);

    vec2 rotation      = getData(iChannel0, DATA_ROT).xy;
    vec2 startRotation = getData(iChannel0, DATA_ROT_ORIGIN).xy;
    vec2 mouseAngle    = asin(iMouse.xy /iResolution.xy / 5.0) * 20.1;

    float mouseClick = getData(iChannel0, DATA_MOUSECLICK).x;

    if(iMouse.w > 0.0) {
        startRotation = mouseAngle;
        mouseClick = 1.0;
    }

    if(mouseClick == 1.0 && iMouse.z > 0.0) {
        rotation += startRotation - mouseAngle;
        startRotation = mouseAngle;
    } else {
        mouseClick = 0.0;
    }

    setData(DATA_ZOOM, zoom);
    setData(DATA_ROT, vec4(rotation, 0, 0));
    setData(DATA_ROT_ORIGIN, vec4(startRotation, 0, 0));
    setData(DATA_MOUSECLICK, mouseClick);    
}
